import React from "react";
import Logo from "../assets/img/waldo-logo.png";
import "./Main.css";

export default function Main() {
	return (
		<main>
			<div className="logo">
				<img src={Logo} alt="Waldo Logo" className="waldo-logo" />
				<h3>Where's Waldo?</h3>
			</div>

			<div className="welcome">
				<h2>Welcome to Where's Waldo!</h2>
				<p>
					This is an implementation of the famous <em>Where's Waldo</em>
					game most of us know and have played at some point in our lives. The way to play
					it is quite easy, you just select a level and find Waldo, once you've found him
					you just click on him. You will also be able to enter the leaderboards and
					compete with others in how fast you were!
				</p>
			</div>
		</main>
	);
}
